import React from "react";
import Form from "./Form";
import { useState } from "react";

function Page(){
    const [url, setUrl] = useState();

    return (
        <div className="m-6">
            <h1 className="text-3xl font-bold text-teal-600"> Webcrawler </h1>
            {url}
            <Form setUrl={[url, setUrl]} />
        </div>
    );
}

export default Page
